import React from 'react';
import Login_Navbar from '../Login_navbar';
import ForgetPassword from '../ForgetPassword';
import Footer from '../Footer';

function ForgetPasswordPage() {
  return (
    <div>
      <Login_Navbar />
      <ForgetPassword />
      <Footer />
    </div>
  );
}

export default ForgetPasswordPage;
